import React from 'react';
import {observer} from 'mobx-react';
import store from './store';

const {value, sum} = store

function App() {
  return (
    <div className="App">
      {
        <h1>{value}</h1>
      }
      <button onClick={(value)=>sum(value)}>+</button>
    </div>
  );
}

export default observer(App);
